  return (
    <div className="App">

      <TodoTitle/>

      <TodoItem />
      <TodoItem />
      <TodoItem />

    </div>
  );
  }

function TodoItem(){ // Creando un complemento que por dentro lleva los elementos que se mostraran en el navegador y se podran reutilizar si es necesario
  return(
    <li>
      <span>V</span>
      <p>Pecho Plano</p>
      <span>X</span>
    </li>
  )
}

export default App;
